+
+      case PacketType.EVENT:
+        this.onevent(packet);
+        break;
+
+      case PacketType.BINARY_EVENT:
+        this.onevent(packet);
+        break;
+
+      case PacketType.ACK:
+        this.onack(packet);
+        break;
+
+      case PacketType.BINARY_ACK:
+        this.onack(packet);
+        break;
+
+      case PacketType.DISCONNECT:
+        this.ondisconnect();
+        break;
+
+      case PacketType.CONNECT_ERROR:
+        const err = new Error(packet.data.message);
