+      debug("performing disconnect (%s)", this.nsp);
+      this.packet({ type: PacketType.DISCONNECT });
+    }
+
+    // remove socket from pool
+    this.destroy();
+
+    if (this.connected) {
+      // fire events
+      this.onclose("io client disconnect");
+    }
+    return this;
+  }
